import React from "react";
import "./PromoVideo.scss";

const PromoVideo = () => {
  return (
    <div className="promocontainer relative mt-20">
      <div className="bg-darkgreen absolute h-full w-full top-0 opacity-60"></div>
    </div>
  );
};

export default PromoVideo;
